sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new OciObjectStorageManagementUtils();
    utils.validateInputVariables(inputs, outputs);
    utils.validateMandatoryVariables(inputs, ["bucketname","namespace"]);
    utils.maptoOutputFromInput(inputs, outputs, ["namespace","bucketname"]);

})(inputs, outputs);

