sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statuscode == "200") {
        try {
            var responseData = JSON.parse(inputs.responseBody);
            outputs.status = "Success";
            outputs.name = responseData.name;
            outputs.id = responseData.id;
            outputs.compartmentid = responseData.compartmentId;
            outputs.metadata = responseData.metadata;
            outputs.responsebody = inputs.responseBody;
          	outputs.free_form_tags = responseData.freeformTags;
            outputs.defined_tags = responseData.definedTags;
          	outputs.bucket_details = responseData;

        } catch (ex) {
            throw new Error('JSON Parse Error. Response Body may be empty.');
        }
    } else {
        var errMsgs = new OciObjectStorageManagement_ErrorHandler().errorHandler(inputs.responseBody);
        outputs.error_message = errMsgs[0];
        outputs.status = errMsgs[1];
    }
})(inputs, outputs);

